const App = () => {
  return (
    <Flex
      justifyContent="center"
      alignItems="center"
      height="100vh"
      flexDirection="column"
      bg={theme.colors.jet}
    >
      <Box marginBottom={100}>
        <svg xmlns="http://www.w3.org/2000/svg" width="103.6px">
          <path d={j} fill="white" />
          <path d={period} fill="white" />
